import pic from './rancell.jpg';

const Photo = () => {
    return ( 

        //Foto de about
        <div className = " col-md-4 mt-4 bg-dark" >
            <div >
                <img src = {pic} className = " rounded border border-white"/> 
            </div>

        </div>
     );
}

export default Photo;
